  return (
    // <Register/>
    <BrowserRouter>
       <Routes>
         <Route path="/">
           <Route
             index
             element={
               <ProtectedRoute>
                 <Home /> 
           </ProtectedRoute>
         }
           />
           <Route path="login" element={<Login />} />
           <Route path="register" element={<Register />} />
         </Route>
       </Routes>
     </BrowserRouter>
  );
}

export default App;
